import "./App.css";
import Nav from './components/Nav';
import CrearJugador from './components/CrearJugador';
import Jugadores from './components/Jugadores';
import Jugador from './components/Jugador';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import ProfilePic from "./components/ProfilePic";


function App() {

  return (
    <Router>
    <div>
      <Nav />
      <div className="App">
        <h1 className='titulo'>Batidora FC</h1>
        <Route path='/crear-jugador' component={CrearJugador} />
        <Route exact path='/jugadores' component={Jugadores} />
        <Route path='/jugadores/:id' component={Jugador} />
        <Route path='/profile-pic' component={ProfilePic} />
      </div>
    </div>
    </Router>
  );
}

export default App;
